    marginBottom: theme.spacing(2),
    backgroundColor: Cyan[800],
    color: theme.palette.getContrastText("#00838f")

    //paddingTop: theme.spacing.unit,
    //paddingBottom: theme.spacing.unit * 2
  },

  rootTitle2: {
    width: "100%",
    marginTop: theme.spacing(2),
    backgroundColor: "#1de9b6"

    //paddingTop: theme.spacing.unit,
    //paddingBottom: theme.spacing.unit * 2
  },

  marg: {
    marginRight: theme.spacing(44)
    // marginBottom: theme.spacing(5)
  },

  colorSwitchBase: {
    color: "#1de9b6",
    "&$colorChecked": {
      color: "#1de9b6",
      "& + $colorBar": {
        backgroundColor: "#1de9b6"
      }
    }
  },
  colorBar: "#1de9b6",
  colorChecked: "#1de9b6",

  checkedRoot: {
    // color: "#00838f",
    "&$checked": {
      color: "#00838f"
    }
  },
  checked: {},

  container2: {
    display: "flex",
    flexWrap: "wrap"
  },
  textField2: {
    //marginLeft: theme.spacing.unit,
    //marginRight: theme.spacing.unit,
    //marginBottom: theme.spacing(2),
    width: 938
  },

  textField3: {
    marginLeft: theme.spacing(23),
    //marginBottom: theme.spacing(5),
    // marginRight: theme.spacing(20),
    width: 300
  },

  title: {
    align: "center"
    //marginTop: theme.spacing(1)
    //marginBottom: theme.spacing(3)
  },
  title2: {
    align: "center",
    marginTop: theme.spacing(1),
    marginBottom: theme.spacing(2)
  },

  menu2: {
    width: 200
  },
  root2: {
    width: 1020,
    paddingBottom: theme.spacing.unit * 2
  },

  root3: {
    width: "5%"
  },

  divider: {
    backgroundColor: "#1de9b6",
    marginBottom: theme.spacing(2)
  },

  saveButton: {
    marginTop: theme.spacing(2),
    marginRight: theme.spacing(2),
    /* this is text color */ color: theme.palette.getContrastText("#00bfa5"),
    backgroundColor: "#00bfa5",
    "&:hover": {
      backgroundColor: "#00bfa5"
    }
  },

  checkBoxRoot: {
    color: "#00838f",
    "&$checked": {
      color: "#00838f"
    }
  },
  checkedBox: { color: "#00838f" }
});

const theme = createMuiTheme({
  palette: {
    primary: { main: "#00838f" }
  }
});

const theme2 = createMuiTheme({
  palette: {
    primary: { main: "#00838f" }
  }
});

const theme3 = createMuiTheme({
  palette: {
    primary: { main: "#00838f" }
  }
});

const titles = [
  {
    value: "",
    label: ""
  },

  {
    value: "Dr.",
    label: "Dr."
  },

  {
    value: "Miss",
    label: "Miss"
  },

  {
    value: "Mr.",
    label: "Mr."
  },
  {
    value: "Mrs.",
    label: "Mrs."
  },
  {
    value: "Ms.",
    label: "Ms."
  },
  {
    value: "Mx.",
    label: "Mx."
  }
];

const clientTypes = [
  {
    value: "Individual",
    label: "Individual"
  },

  {
    value: "Facility",
    label: "Facility"
  }
];

const sessionTypes = [
  {
    value: "Lessons",
    label: "Lessons"
  },

  {
    value: "Therapy",
    label: "Therapy"
  }
];

const paymentTypes = [
  {
    value: "Card",
    label: "Card"
  },

  {
    value: "Cash",
    label: "Cash"
  },

  {
    value: "Check",
    label: "Check"
  }
];

const cardTypes = [
  {
    value: "American Express",
    label: "American Express"
  },

  {
    value: "Discover",
    label: "Discover"
  },

  {
    value: "MasterCard",
    label: "MasterCard"
  },
  {
    value: "Visa",
    label: "Visa"
  }
];

const navStyle = {
  color: "black",
  textDecoration: "none"
};

class TopPanel extends React.Component {
  state = {
    //client info state
    clientType: "",
    clientFirstName: "",
    clientLastName: "",
    clientEmail: "",
    clientTitle: "",
    clientCurrentPassword: "",
    clientConfirmPassword: "",
    sessionType: "",
    sessionCost: "",
    sessionLegnth: "",
    clientPhone: "",
    clientAddress: "",
    clientBday: "",
    clientState: "",
    clientCity: "",
    clientZipCode: "",
    clientStreetAddress: "",
    clientNotes: "",
    multiline: "Controlled",
    //contact info state
    checkedSameCont: null,
    contactFirstName: "",
    contactLastName: "",
    contactEmail: "",
    contactTitle: "",
    contactPhone: "",
    contactAddress: "",
    contactCity: "",
    contactState: "",
    contactZip: "",
    // contact 2 info state
    contactFirstName2: null,
    contactLastName2: null,
    contactEmail2: null,
    contactTitle2: null,
    contactPhone2: null,
    contactAddress2: null,
    contactCity2: null,
    contactState2: null,
    contactZip2: null,
    // contact 3 info state
    contactFirstName3: null,
    contactLastName3: null,
    contactEmail3: null,
    contactTitle3: null,
    contactPhone3: null,
    contactAddress3: null,
    contactCity3: null,
    contactState3: null,
    contactZip3: null,
    //payor info state
    billingFirstName: "",
    billingLastName: "",
    nameOnCard: "",
    cardNum: "",
    payorEmail: "",
    payorTitle: "",
    paymentType: "Cash",
    billingPhone: "",
    billingAddress: "",
    billingCity: "",
    billingZip: "",
    billingState: "",
    cvv: "",
    expDate: "",
    cardType: "",
    sameAsContact: false,
    //toDashboard: false,
    navigate: false,
    //intervalIsSet: ""
    therapistData: [],
    therapist: "",
    // condition
    checkedContact2: false,
    checkedContact3: false
  };
  /*
  reloadPage() {
    // if (this.state.location !== prevState.location) {
    window.location.reload();
    console.log("Refresh!");
  }
*/
  componentDidMount() {
    axios
      .get("http://localhost:5000/allclients")
      .then(response => {
        console.log("Got client data!");
        console.log(response.data);
        this.setState({
          clientData: response.data
        });
      })
      .then(response2 => {
        return axios
          .get("http://localhost:5000/gettherapists") // this is not using the sequelize method
          .then(response2 => {
            console.log("Got therapist data!");
            console.log(response2.data);
            this.setState({
              therapistData: response2.data
            });
          });
      })
      .catch(function(error) {
        console.log(error);
      });

    if (!this.state.intervalIsSet) {
      let interval = setInterval(this.getDataFromDb, 1000);
      this.setState({ intervalIsSet: interval });
      console.log("Data interval set!");
    }
  }

  componentWillUnmount() {
    if (this.state.intervalIsSet) {
      clearInterval(this.state.intervalIsSet);
      this.setState({ intervalIsSet: null });
      console.log("Unmounted from client data!");
    }
  }

  onSubmit() {
    //experiment keeping preventDefault
    //e.preventDefault();

    const clientObj = {
      // client info
      checkedActive: false,
      clientType: this.state.clientType,
      clientFirstName: this.state.clientFirstName,
      clientLastName: this.state.clientLastName,
      clientEmail: this.state.clientEmail,
      clientTitle: this.state.clientTitle,
      clientCurrentPassword: this.state.clientCurrentPassword,
      clientConfirmPassword: this.state.clientConfirmPassword,
      clientPhone: this.state.clientPhone,
      clientAddress: this.state.clientAddress,
      sessionType: this.state.sessionType,
      sessionCost: this.state.sessionCost,
      sessionLength: this.state.sessionLegnth,
      clientBday: this.state.clientBday,
      clientState: this.state.clientState,
      clientCity: this.state.clientCity,
      clientZipCode: this.state.clientZipCode,
      clientStreetAddress: this.state.clientStreetAddress,
      clientNotes: this.state.clientNotes,
      // contact info
      contactFirstName: this.state.contactFirstName,
      contactLastName: this.state.contactLastName,
      contactEmail: this.state.contactEmail,
      contactTitle: this.state.contactTitle,
      contactPhone: this.state.contactPhone,
      contactAddress: this.state.contactAddress,
      contactCity: this.state.contactCity,
      contactState: this.state.contactState,
      contactZip: this.state.contactZip,
      // contact 2 info
      contactFirstName2: this.state.contactFirstName2,
      contactLastName2: this.state.contactLastName2,
      contactEmail2: this.state.contactEmail2,
      contactTitle2: this.state.contactTitle2,
      contactPhone2: this.state.contactPhone2,
      contactAddress2: this.state.contactAddress2,
      contactCity2: this.state.contactCity2,
      contactState2: this.state.contactState2,
      contactZip2: this.state.contactZip2,
      // contact 3 info
      contactFirstName3: this.state.contactFirstName3,
      contactLastName3: this.state.contactLastName3,
      contactEmail3: this.state.contactEmail3,
      contactTitle3: this.state.contactTitle3,
      contactPhone3: this.state.contactPhone3,
      contactAddress3: this.state.contactAddress3,
      contactCity3: this.state.contactCity3,
      contactState3: this.state.contactState3,
      contactZip3: this.state.contactZip3,
      // payor info
      billingFirstName: this.state.billingFirstName,
      billingLastName: this.state.billingLastName,
      nameOnCard: this.state.nameOnCard,
      cardNum: this.state.cardNum,
      payorEmail: this.state.payorEmail,
      payorTitle: this.state.payorTitle,
      paymentType: this.state.paymentType,
      billingPhone: this.state.billingPhone,
      billingAddress: this.state.billingAddress,
      billingCity: this.state.billingCity,
      billingZip: this.state.billingZip,
      billingState: this.state.billingState,
      cvv: this.state.cvv,
      expDate: this.state.expDate,
      cardType: this.state.cardType
    };
    axios
      .post("http://localhost:5000/clients/registerclient", clientObj)
      .then(res => console.log(res.data));
    /* this will clear everything after saving+closing */

    this.setState({
      //client info
      clientObj
    });
  }

  handleChange = name => event => {
    this.setState({ [name]: event.target.value });
  };

  handleChange2 = name => event => {
    this.setState({ [name]: event.target.value });
  };

  handleChangeCheckSameCont = name => event => {
    this.setState({
      [name]: event.target.checked,
      //this will set the values to blank once the window is closed
      contactFirstName: this.state.clientFirstName,
      contactLastName: this.state.clientLastName,
      contactEmail: this.state.clientEmail,
      contactTitle: this.state.clientTitle,
      contactPhone: this.state.clientPhone,
      contactAddress: this.state.clientAddress,
      contactCity: this.state.clientCity,
      contactState: this.state.clientState,
      contactZip: this.state.clientZipCode
    });
  };

  handleChangeCheck2 = name => event => {
    this.setState({
      [name]: event.target.checked,
      //this will set the values to blank once the window is closed
      contactFirstName2: null,
      contactLastName2: null,
      contactEmail2: null,
      contactTitle2: null,
      contactPhone2: null,
      contactAddress2: null,
      contactCity2: null,
      contactState2: null,
      contactZip2: null,
      // contact 3,
      checkedContact3: false,
      contactFirstName3: null,
      contactLastName3: null,
      contactEmail3: null,
      contactTitle3: null,
      contactPhone3: null,
      contactAddress3: null,
      contactCity3: null,
      contactState3: null,
      contactZip3: null
    });
  };

  handleChangeCheck3 = name => event => {
    this.setState({
      [name]: event.target.checked,
      //this will set the values to blank once the window is closed
      contactFirstName3: null,
      contactLastName3: null,
      contactEmail3: null,
      contactTitle3: null,
      contactPhone3: null,
      contactAddress3: null,
      contactCity3: null,
      contactState3: null,
      contactZip3: null
    });
  };

  handleChangeCheck = name => event => {
    this.setState({ [name]: event.target.checked });
  };
  toggleShow = () => {
    this.setState(state => ({ isShow: !state.isShow }));
  };

  /*
  handleSubmit = (user) => {
    saveUser(user)
      .then(() => this.setState(() => ({
        toDashboard: true
      })))
  }
  */
  /*
  setLocation() {
    this.props.history.push("/clients");
  } */

  render() {
    const { classes } = this.props;
    const { therapistData } = this.state;
    /*
    if (this.state.toDashboard === true) {
        return <Redirect to='/dashboard' />
      }
  */
    /*

    const { navigate } = this.state;

    // here is the important part
    if (navigate) {
      return <Redirect to="/clients" push={true} />;
    }
    */

    return (
      <Container maxWidth="lg">
        <form className={classes.container} noValidate autoComplete="off">
          <Paper className={classes.root} elevation={1}>
            <Paper className={classes.rootTitle} elevation={0}>
              <Typography className={classes.title} align="center" variant="h5">
                Client Information
              </Typography>
            </Paper>

            <Grid container justify="center" alignItems="center">
              <Grid container row justify="center" alignItems="center">
                <MuiThemeProvider theme={theme}>
                  <FormGroup row>
                    <FormControlLabel
                      className={classes.marg}
                      control={
                        <MuiSwitch
                          checked={this.state.checkedActive}
                          onChange={this.handleChangeCheck("checkedActive")}
                          value="checkedActive"
                          // marginLeft="theme.spacing(2)"

                          /*
                        classes={{
                          switchBase: "#1de9b6",
                          checked: "#1de9b6",
                          bar: "#1de9b6"
                        }}*/
                          color="primary"
                        />
                      }
                      label="Active"
                    />
                  </FormGroup>
                </MuiThemeProvider>

                <TextField
                  id="standard-select-clientType"
                  select
                  label="Client Type"
                  variant="outlined"
                  className={classes.textField3}
                  value={this.state.clientType}
                  onChange={this.handleChange("clientType")}
                  SelectProps={{
                    MenuProps: {
                      className: classes.menu
                    }
                  }}
                >
                  {clientTypes.map(option => (
                    <MenuItem key={option.value} value={option.value}>
                      {option.label}
                    </MenuItem>
                  ))}
                </TextField>
              </Grid>
              <Grid container row justify="center" alignItems="center"></Grid>
              <TextField
                id="standard-select-title"
                select
                label="Title"
                variant="outlined"
                className={classes.textField}
                value={this.state.clientTitle}
                onChange={this.handleChange("clientTitle")}
                SelectProps={{
                  MenuProps: {
                    className: classes.menu
                  }
                }}
              >
                {titles.map(option => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </TextField>
              <MuiThemeProvider theme={theme}>
                <TextField
                  required
                  id="standard-firstName"
                  label="First Name"
                  variant="outlined"
                  color={theme}
                  className={classes.textField}
                  value={this.state.clientFirstName}
                  onChange={this.handleChange("clientFirstName")}
                  margin="normal"
                />
              </MuiThemeProvider>
              <TextField
                required
                id="standard-lastNamename"
                label="Last Name"
                variant="outlined"
                className={classes.textField}
                value={this.state.clientLastName}
                onChange={this.handleChange("clientLastName")}
                margin="normal"
              />
              <TextField
                required
                id="standard-email"
                variant="outlined"
                label="Email"
                className={classes.textField}
                value={this.state.clientEmail}
                onChange={this.handleChange("clientEmail")}
                margin="normal"
              />
              <TextField
                required
                id="standard-password-input"
                variant="outlined"
                label="Password"
                className={classes.textField}
                type="password"
                value={this.state.clientCurrentPassword}
                onChange={this.handleChange("clientCurrentPassword")}
                //autoComplete="current-password"
                margin="normal"
              />
              <TextField
                required
                id="standard-confirmPassword-input"
                variant="outlined"
                label="Confirm Password"
                className={classes.textField}
                type="password"
                value={this.state.confirmPassword}
                onChange={this.handleChange("confirmPassword")}
                //autoComplete="current-password"
                margin="normal"
              />

              <TextField
                id="standard-address"
                variant="outlined"
                label="Address"
                className={classes.textField}
                value={this.state.clientAddress}
                onChange={this.handleChange("clientAddress")}
                margin="normal"
              />
              <TextField
                id="standard-city-"
                variant="outlined"
                label="City"
                className={classes.textField}
                value={this.state.clientCity}
                onChange={this.handleChange("clientCity")}
                margin="normal"
              />
              <TextField
                id="standard-state"
                variant="outlined"
                label="State"
                className={classes.textField}
                value={this.state.clientState}
                onChange={this.handleChange("clientState")}
                margin="normal"
              />
              <TextField
                id="standard-zipCode"
                variant="outlined"
                label="Zip Code"
                className={classes.textField}
                value={this.state.clientZipCode}
                onChange={this.handleChange("clientZipCode")}
                margin="normal"
              />
              <TextField
                id="standard-phone"
                variant="outlined"
                label="Phone Number"
                className={classes.textField}
                value={this.state.clientPhone}
                onChange={this.handleChange("clientPhone")}
                margin="normal"
              />
              <TextField
                id="standard-bday"
                variant="outlined"
                label="Birthday"
                className={classes.textField}
                value={this.state.clientBday}
                onChange={this.handleChange("clientBday")}
                margin="normal"
              />

              <TextField
                id="standard-select-sessionType"
                select
                label="Session Type"
                variant="outlined"
                margin="normal"
                className={classes.textFieldSession}
                value={this.state.sessionType}
                onChange={this.handleChange("sessionType")}
                SelectProps={{
                  MenuProps: {
                    className: classes.menu
                  }
                }}
              >
                {sessionTypes.map(option => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </TextField>
              <TextField
                id="standard-cost"
                label="Session Cost (dollars)"
                variant="outlined"
                className={classes.textFieldSession}
                value={this.state.sessionCost}
                onChange={this.handleChange("sessionCost")}
                margin="normal"
              />
              <TextField
                id="standard-length"
                label="Session Length (minutes)"
